import Vue from 'vue'
import VueRouter from 'vue-router'
import Main from '../views/Main.vue'
import login from '../views/Login/login.vue'


Vue.use(VueRouter)

const routes = [
    {
       path: '/',
       name: 'Main',
       component: Main,
       redirect: 'home',
    },
    {
        path: '/login',
        name: 'login',
        component: login 
    }

]

const router = new VueRouter({
    mode: 'history',
    routes
})
export default router
